{"10": ["Хороший знак. Желаю, чтобы никто его никогда не использовать.", "2021-01-07T14:30:34Z", "", "0", 5, 0, 5, "Знак аварийной остановки", "Autofamily"], "11": ["К сожалению пришлось воспользоваться - одноразовый, пластик очень хрупкий- сломалось крепление", "2020-12-24T04:17:07Z", "", "0", 2, 0, 2, "Знак аварийной остановки", "Autofamily"], "12": ["Я в восторге. Счастлив. Нет слов!", "2020-12-15T16:40:47Z", "", "0", 1, 1, 5, "Знак аварийной остановки", "Autofamily"], "14": ["Полностью устроил сам знак, а вот к \"пластиковому\" контейнер для хранения вопросы. Он мягкий как бумага, качества 0, но он не критично важен, по этому только 1 звезду сниму", "2020-10-23T03:03:42Z", "красный", "0", 1, 0, 4, "Знак аварийной остановки RT-611 (Fuding, Китай)", "Autofamily"], "20": ["Супер) очень хорошая цена и все целое ", "2020-11-18T18:34:56Z", "красный", "0", 1, 0, 5, "Знак аварийной остановки RT-611 (Fuding, Китай)", "Autofamily"], "22": ["Отличный знак! Товар соответствует описанию!", "2020-11-15T16:49:49Z", "красный", "0", 2, 0, 5, "Знак аварийной остановки RT-611 (Fuding, Китай)", "Autofamily"], "24": ["Качество хорошее, данный тип ножек на практике оказался самым устойчивым на ветру и на неровной поверхности дороги. Размер треугольника  42,5х42,5х42,5см. За 178 руб. отличный знак. ", "2020-11-10T18:05:02Z", "красный", "0", 3, 0, 5, "Знак аварийной остановки RT-611 (Fuding, Китай)", "Autofamily"], "29": ["Отличный знак, длинные широко расставленные ножки дают ему хорошую устойчивость, а вместо дешёвой клеёнки по середине оранжевый треугольник из достаточно плотного крепкого материала. Лишь бы не пригодился.", "2020-10-18T16:46:02Z", "красный", "0", 2, 0, 5, "Знак аварийной остановки RT-611 (Fuding, Китай)", "Autofamily"], "30": ["Знак отличный, рекомендую!", "2020-10-18T08:17:47Z", "красный", "0", 1, 0, 5, "Знак аварийной остановки RT-611 (Fuding, Китай)", "Autofamily"], "31": ["Знак очень понравился. Сделан хорошо. Такой тип подставки самый удачный. Однако, размеры знака не по ГОСТу - длина грани здесь 430 мм, а должна быть 450-550 мм. Чехол плохой - очень тонкий и хлипкий пластик.\nЗа 166 рублей - хороший вариант.", "2020-10-14T10:46:28Z", "красный", "0", 1, 0, 5, "Знак аварийной остановки RT-611 (Fuding, Китай)", "Autofamily"], "35": ["Качество норм, лижбы не пригодилось...", "2020-10-05T17:57:51Z", "красный", "0", 2, 0, 5, "Знак аварийной остановки RT-611 (Fuding, Китай)", "Autofamily"], "38": ["Хороший,устойчивый знак. Рекомендую!!!!!!!", "2020-09-19T13:59:35Z", "красный", "0", 2, 0, 5, "Знак аварийной остановки RT-611 (Fuding, Китай)", "Autofamily"], "39": ["Хороший знак за такие деньги.", "2020-08-19T21:32:23Z", "красный", "0", 1, 0, 5, "Знак аварийной остановки RT-611 (Fuding, Китай)", "Autofamily"], "40": ["Хорошее качество.Надеюсь не пригодиться.Выбирал с широкими ножками чтоб не сдувало.", "2020-08-19T17:53:32Z", "красный", "0", 1, 0, 5, "Знак аварийной остановки RT-611 (Fuding, Китай)", "Autofamily"], "41": ["Отличный знак. Материал не хлипкий. Стоит устойчиво. Рекомендую!", "2020-08-09T15:01:01Z", "красный", "0", 1, 0, 5, "Знак аварийной остановки RT-611 (Fuding, Китай)", "Autofamily"], "43": ["Нормальный знак. Намного не дотягивает до требований ПДД (длина стороны 50-55 см должна быть), но я не нашла нигде знака, удовлетворяющего этим требованиям. В Глобусе, кстати, точно такой знак стоил больше 500 руб.", "2020-06-24T14:34:03.179099278Z", "красный", "0", 2, 0, 5, "Знак аварийной остановки RT-611 (Fuding, Китай)", "Autofamily"], "44": ["Отличный знак!рекомендую!", "2020-06-23T18:42:00.761592671Z", "красный", "0", 2, 0, 5, "Знак аварийной остановки RT-611 (Fuding, Китай)", "Autofamily"], "46": ["Даже не ожидала,что за 119руб.придет такой хороший знак.Оченьхороший!", "2020-06-20T05:37:24.01653611Z", "красный", "0", 1, 0, 5, "Знак аварийной остановки RT-611 (Fuding, Китай)", "Autofamily"], "48": ["Суперский знак))) надеюсь не пригодится. В спец.магазине стоит дороже.", "2020-01-10T19:58:34.073008615Z", "красный", "0", 1, 0, 5, "Знак аварийной остановки RT-611 (Fuding, Китай)", "Autofamily"], "52": ["Нормальный знак,за эти деньги просто прелесть))", "2019-12-16T18:57:17.15861672Z", "красный", "0", 2, 0, 5, "Знак аварийной остановки RT-611 (Fuding, Китай)", "Autofamily"], "54": ["Крепкий,  качественный,  дай Бог , что б не пригодился))), но иметь такой нужно!", "2019-12-12T17:42:16.797383777Z", "красный", "0", 4, 0, 5, "Знак аварийной остановки RT-611 (Fuding, Китай)", "Autofamily"], "58": ["Крепление в месте стыка пластиковой круглой заглушки не продумано и не зафиксировано. Пришлось самой заклеивать на супер клей. Подпорки очень достойные, держат знак уверенно, только из-за них и выкупила. За заглушку, которая отваливается снимаю две звёзды, т к пришлось тратиться ещё на супер клей. В целом, товар качественный и добротный, но нужно доработать круглую заглушку. ", "2019-11-13T12:11:08.386912523Z", "красный", "0", 2, 0, 3, "Знак аварийной остановки RT-611 (Fuding, Китай)", "Autofamily"]}
